		<Container>
			<Navbar />
			<Announcement />
			<Title>Dresses</Title>
			<FilterContainer>
				<Filter>
					Filter1
				</Filter>
				<Filter>
					Filter2
				</Filter>
			</FilterContainer>
		</Container>
	)
}

export default ProductList;
